    return (
        <div class="split-left">
            <div class="centered">
                <img src='static/wood.PNG.png'/>
            </div>
            <style jsx>
                {`img {
                    height: 600px;
                    width: 600px;
                }
               `}
            </style>
        </div>
    )
}
